import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import AddIcon from '@mui/icons-material/Add';

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: '#ffffff', // Fondo blanco
  borderTop: '1px solid #ccc',
});

const CenteredIconButton = styled(IconButton)({
  flex: 1,
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
});

export default function BottomAppBar() {
  return (
    <StyledAppBar position="fixed" color="primary">
      <Toolbar>
        <IconButton color="inherit">
          {/* Tu icono de retroceso aquí */}
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1, textAlign: 'center' }}>
          Tu Aplicación
        </Typography>
        <CenteredIconButton color="inherit">
          <AddIcon style={{ color: '#000000' }} />
        </CenteredIconButton>
        <IconButton color="inherit">
          {/* Tu icono de notificaciones aquí */}
        </IconButton>
        <IconButton color="inherit">
          {/* Tu icono de cuenta aquí */}
        </IconButton>
      </Toolbar>
    </StyledAppBar>
  );
}
